INSERT INTO `posts` VALUES (4,'DS & AI Conference','3rd International Conference on Data Science & Artificial Intelligence','##### Jointly organised by **Postgraduate Institute of Science, University of Peradeniya, Sri Lanka** and **Department of Statistics, University of Sri Jayawardenapura, Sri Lanka**\r\n\r\nThe DSAI 2025 Conference is dedicated to advancing data science and artificial intelligence (AI) knowledge, with a strong focus on supporting growth in developing countries. This global event serves as a premier platform for researchers, academics, and practitioners from both developed and developing regions to exchange expertise, showcase innovative solutions, and discuss the latest advancements in data science and AI. DSAI 2025 fosters collaboration and capacity-building, offering a unique opportunity for participants to network, form strategic partnerships, and drive impactful research and applications. By engaging directly with the local community, the conference promotes awareness and encourages the adoption of AI and data science innovations, empowering nations to leverage these technologies for sustainable growth and development. Join us at DSAI 2025 to be part of a transformative experience that connects global leaders in artificial intelligence and data science with emerging innovators from around the world. Together, let\'s shape the future of AI and data science in developing regions.',_binary 'PNG\r\n\Z\n\0\0\0\rIHDR\0\0v\0\0X\0\0\0.|t\0\0\0sRGB\0\\\0\0\0gAMA\0\0a\0\0\0	pHYs\0\0\\0\0\\od\0\0IDATx^LWe[v\]n\\\\HV \0=Ջބ<f-tw	\ 2d,25q\v\L\&\MDd\\{\i\~wUPJA)EPJ!\LəRP\nTh@ej-T*\nCESFUPTJ)\ZQ?T\kU29gr.\RQZU\n\a\x\0R*JK\j\=ݦ!\\<sFlg 牒*Xq^\3loQh^_Uq>/\XR\\\#77w\[j\\\/g\qeAí*?r\RfI	48kB-ȳU\\%\\\ϊ\Q\(Ӵ\\4\ǉ%.``i\l\r\\k27[Zg(!CVPZ)S\6-h#?<9_#mU2TR\ZPZ1!\ԒP\R!.-)\lw-ooq\?c\vwKNZeJ8gwؓk\:sz\L\̲J5c\\P\\dj\:Z1M3Z\\nU*z]{>LY\\Ze-$\r\:q\jVh\0]\'\\\ܢ\x$1e4҅~kc	\o(e+\\_3^hS(*\G\7\\B\l7<>R&\\q\tNŐA\